import router from "@ohos.router";

@Entry
@Component
struct Main {
  @State message: string = "Hello World";

  build() {
    Row() {
      Text(this.message)
        .fontSize(20)
        .fontWeight(FontWeight.Bold)
        .onClick(() => {
          router.push({
            url: "pages/SecondPage",
            params: {
              message: "Hello from Second Page",
            },
          });
        })
        .width(200)
        .height(100)

    }
  }
}

